  return (
    <div className="d-flex align-items-center">
      {/* <Link to={config.routesConfig.root}><HomeIcon color="primary" className="ms-2" /></Link> */}
      {name ? (
        <div>
          <div>
            <span>Gareral</span>
          </div>
          <div>
            <span>{name}</span>
          </div>
        </div>
      ) : null}
    </div>
  );
};

export default HeaderContent;
